import React from 'react'
import Ticker from 'react-ticker'
 
const MoveStuffAround = () => (
    <Ticker>
        {({ index }) => (
            <h1 class="white-100 fw3">This is the Headline of element #{index}!</h1>
            
        )}
    </Ticker>
)
 
export default MoveStuffAround
